    const [value, setValue] = useState(false);

  return (
          <div className="App">
              <UserContext.Provider value={{value, setValue}}>
                  <GlobalFonts/>
                  <AppRoutes />
                  <HeaderNavigation/>

              </UserContext.Provider>

              <MessengerCustomerChat
                  pageId="111788123985865"
                  appId="949279658890551"
                  htmlRef="<REF_STRING>"
              />,
          </div>
  );
}


export default App;

